import React from 'react';
import UserList from '../components/UserList';
import Events from '../components/Events';

const HomePage = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-8">
                    <h1 className="my-4">Etkinlikler</h1>
                    <Events />
                </div>

            </div>
        </div>


        /*
            <div className="container">
                <UserList />
            </div>
        */
    );
};

export default HomePage;
